import React from "react";
import "BreadcrumbNavigation.css";

const BreadcrumbNavigation = () => {
  return (
    <div className="breadcrumb_navigation">
      <div className="breadcrumb_navigation_list">
        <div className="breadcrumb_navigation_item">Home</div>
        <div className="breadcrumb_navigation_item">Auction Calendar</div>
        <div className="breadcrumb_navigation_item">Sale List for Georgia</div>
        <div className="breadcrumb_navigation_item">2014 - BMW 3er Touring</div>
      </div>
      <div>
        <button className="navigation" disabled>
          Previous
        </button>
        <button className="navigation">Next</button>
      </div>
    </div>
  );
};

export default BreadcrumbNavigation;
